constexpr int N = 8;
using Board = uint64_t;

constexpr Board col_mask = (1ULL << N) - 1;
constexpr Board diag1_mask = (1ULL << (2 * N - 1)) - 1;
constexpr Board diag2_mask = (1ULL << (2 * N - 1)) - 1;

